         id="tspan82">Mave – baller – lår </tspan></text>

         y="0"
         id="tspan86">På dette hold har vi primært fokus på mave, </tspan><tspan
         x="0 5.8045001 11.0865 13.7275 16.3685 21.650499 25.346001 28.253 34.057499 39.862 42.769001 45.41 50.692001 53.5154 56.156399 59.0634 67.508904 72.790901 78.595398 81.502403 87.3069 93.111397 96.018402 99.713898 104.9959 108.6914 111.5984 115.2939 118.9894 123.7394 127.4349 132.7169 137.9989 141.6944 144.60139 150.4059 156.2104 159.1174 162.8129 166.50841 170.2039 175.4859 183.9314 192.37691 197.65891 201.3544"
         y="11.9985"
         id="tspan88">baller og lår, men du får styrket og strammet </tspan><tspan
         x="0 8.4455004 14.25 17.945499 23.227501 29.032 31.673 36.955002 40.650501 46.455002 50.150501 55.432499 61.237 64.143997 66.785004 69.692001 75.496498 80.778503 83.419502 88.7015 91.608498 96.890503 100.586 106.3905 112.195 117.9995 123.2815 129.086 131.72701"
         y="23.997"
         id="tspan90">muskulaturen i hele kroppen. </tspan><tspan
         x="0 6.1673999 8.8084002 11.7154 16.465401 21.7474 25.4429 33.888401 39.170399 42.865898 45.7729 51.5774 57.381901 60.288898 68.734398 74.016403 79.8209 82.727898 88.009903 93.8144 99.618896 105.4234 108.0644 111.7599 114.4009 120.2054 126.0099 129.7054 133.40089 137.09641 145.5419 151.34641 153.9874 159.7919 165.59641 168.2374 171.14439 176.9489 182.2309 185.92641 191.2084 194.9039 198.5994 203.88139 207.5769 210.4839 216.28841 221.5704 225.2659"
         y="35.995499"
         id="tspan92">Vi varmer op med konditionstræning, herefter går </tspan><tspan
         x="0 4.75 7.3909998 10.298 16.102501 20.852501 26.134501 29.83 32.737 36.432499 39.073502 41.7145 44.621498 48.317001 54.121498 57.817001 61.512501 66.794502 72.0765 74.717499 77.358498 79.999496 85.804001 91.085999 93.992996 97.688499 102.4385 108.243 113.525 117.2205 120.1275 125.4095 129.105 132.01199 137.8165 142.5665 147.8485 150.4895 154.185 159.467 163.16251 166.0695 169.765 175.5695 184.015 186.922 190.61749 196.422 202.2265 207.5085 211.20399 214.89951"
         y="47.993999"
         id="tspan94">vi over til forskellige typer af øvelser som squats </tspan><tspan
         x="0 5.8045001 11.609 14.516 22.9615 28.2435 32.9935 38.275501 44.080002 49.884499 52.525501 58.330002 60.971001 66.775497 72.580002 77.862 81.557503 84.4645 88.160004 93.442001 101.8875 105.583 108.49 114.2945 119.0445 124.3265 126.9675 130.66299 135.94501 139.6405 142.5475 150.993 156.27499 162.0795 164.9865 170.26849 172.9095 178.1915 181.88699 185.5825 188.2235 193.50549 198.78751 204.0695 207.765 210.672 216.4765 222.28101"
         y="59.9925"
         id="tspan96">og mavebøjninger samt øvelser med elastikker og </tspan><tspan
         x="0 5.8045001 11.609 14.25 20.054501 25.3365 27.977501 30.884501 35.463501 39.159 47.6045 53.409 56.049999 61.8545 67.658997 72.941002 78.745499 81.652496 86.934502 90.629997 93.537003 101.9825 107.2645 109.9055 113.601 118.883 122.5785 126.274 131.556 135.2515 138.15849 143.44051 148.19051 150.8315 156.636 162.44051 167.7225 170.5459 173.1869 176.0939 184.5394 189.8214 195.6259 198.5329 206.97839 215.4239 221.22839 227.0329"
         y="71.990997"
         id="tspan98">bolde. Træningen er målrettet kvinder, men mænd </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.688999 23.4935 27.188999 32.471001 35.377998 40.127998 45.41 48.050999 53.333 59.137501 67.583 73.387497 78.669502"
         y="83.989502"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,62.3524,554.8809)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text148"><tspan
         x="0 6.8590002 9.5 12.141 17.423 20.33 25.08 27.987 33.7915 39.073502 44.877998 50.16 53.067001 58.348999 63.098999 65.739998 71.544502 77.348999 82.630997 86.3265 89.233498 95.038002 100.8425 103.7495 112.195 120.6405 126.445 132.2495 135.15649 139.90649 142.81351 148.618 153.89999 157.5955 160.5025 165.7845 168.42551 172.121 177.403 182.685 186.38049 189.28751 194.5695 198.265 201.172 206.9765 212.2585 218.063 221.7585 227.0405"
         y="0"
         id="tspan134">Alle – både kvinder og mænd – der elsker at danse </tspan><tspan
         x="0 5.8045001 11.609 14.516 20.320499 25.602501 30.352501 38.798 44.602501 49.884499 52.7915 56.487 59.127998 64.932503 67.8395 71.535004 74.176003 76.817001 79.723999 88.169502 93.973999 97.669502 100.3105 105.5925 108.2335 111.1405 116.4225 120.118 123.025 127.775 133.05701 135.698 140.98 146.7845 155.23 161.0345 166.3165 169.2235 175.028 180.31 183.217 189.0215 194.3035 197.99899 201.6945 206.9765 209.8835 215.688 221.49249 224.1335 229.938 232.57899"
         y="11.9985"
         id="tspan136">og bevæge sig til musik, er velkomne på dette hold. </tspan><tspan
         x="0 5.2820001 11.0865 19.532 25.3365 30.6185 33.525501 38.807499 42.502998 45.41 51.2145 56.496498 62.300999 65.996498 71.278503 79.723999 85.528503 89.223999 91.864998 97.669502 103.474 106.381 112.1855 117.4675 121.163 126.445 130.1405 135.4225 139.118 142.02499 147.8295 153.1115 156.01849 158.6595 163.9415 167.63699 170.278 176.0825 181.3645 189.81 195.092 198.78751 201.4285 206.71049 211.99249 217.797 221.49249 226.77451 232.0565"
         y="23.997"
         id="tspan138">Zumba er dansemotion baseret på latinamerikanske </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 20.5865 25.8685 29.563999 33.259499 35.900501 41.705002 44.346001 47.252998 53.057499 58.3395 62.035 67.8395 73.643997 79.448502 84.730499 88.426003 91.333 95.028503 100.3105 102.9515 106.647 111.929 114.836 120.6405 126.445 129.35201 133.0475 138.3295 146.77499 152.5795 157.8615 160.5025 163.4095 167.98946 171.68495 174.32594 180.13045 185.41245 191.21695 196.49895 199.40594 204.68794 208.38345 211.29045 213.93146 219.21346 222.90895 226.60445 231.88644"
         y="35.995499"
         id="tspan140">dansetrin, herunder salsa og samba. Trinene er lette </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 14.5255 22.971001 26.6665 31.9485 34.5895 37.496498 41.192001 46.473999 49.381001 55.185501 60.990002 63.896999 69.179001 72.874496 75.781502 81.585999 87.390503 91.085999 94.781502 97.422501 103.227 106.9225 109.8295 118.275 123.557 129.3615 132.0025 134.9095 140.89545 146.17744 151.98195 154.88895 160.17094 163.86646 166.77345 172.57796 177.85995 183.66444 187.35995 192.64195 195.54895 200.29895 206.10345 214.54895 220.35345 225.63545"
         y="47.993999"
         id="tspan142">at lære, så du er hurtigt med. Ved at danse zumba </tspan><tspan
         x="0 3.6954999 8.9775 12.673 15.58 21.384501 27.188999 30.096001 33.7915 37.487 42.237 45.932499 51.2145 56.496498 60.192001 63.098999 68.380997 74.185501 79.989998 85.794502 88.435501 92.130997 94.772003 100.5765 106.381 111.663 117.4675 120.1085 123.0155 128.2975 134.10201 139.90649 143.60201 149.40649 152.0475 157.85201 163.134 166.8295 169.4705 175.27499 181.0795 186.3615 192.166 195.073 198.76849 204.05051 212.496 216.1915"
         y="59.9925"
         id="tspan144">får du styrket konditionen, koordinationen samt </tspan><tspan
         x="0 5.2820001 8.9775 14.782 20.5865 26.391001 31.673 37.477501 41.173 44.080002 47.775501 53.580002 57.275501 60.971001 66.252998 71.535004 74.176003 76.817001 79.458 85.262497 90.544502 93.4515 101.897 107.7015 111.397 116.679 119.32 124.602 127.4254 130.06641"
         y="71.990997"
         id="tspan146">kroppens forskellige muskler. </tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text194"><tspan
         x="0 5.2820001 10.564 13.471 19.275499 24.557501 28.253 31.9485 37.230499 40.137501 45.942001 51.746498 54.387501 60.192001 63.098999 68.380997 72.0765 77.880997 83.163002 85.804001 91.608498 96.890503 100.586 103.493 108.243 110.884 113.791 122.2365 127.5185 133.323 136.23 141.51199 145.2075 148.1145 153.91901 159.7235 165.528 170.278 176.0825 181.88699 187.16901 190.076 195.358 199.0535 204.858 210.66251 216.467 221.74899 227.5535 231.24899"
         y="0"
         id="tspan180">På dette hold arbejder vi med at opbygge kroppens </tspan><tspan
         x="0 8.4455004 14.25 17.945499 23.227501 25.8685 31.150499 34.846001 37.752998 46.198502 51.480499 57.285 60.192001 65.473999 70.755997 74.4515 78.147003 81.842499 87.124496 90.031502 93.726997 99.531502 104.8135 110.618 114.3135 117.2205 123.025 128.30701 131.214 139.6595 145.464 149.1595 154.4415 157.0825 162.3645 166.06 171.8645 177.1465 180.0535 182.6945 185.6015 189.297 194.047 199.8515 202.49249 205.39951 213.845 219.127 223.877 229.159 231.8"
         y="11.9985"
         id="tspan182">muskler med ekstra fokus på musklerne i ryg, mave, </tspan><tspan
         x="0 5.8045001 11.0865 16.3685 21.650499 26.932501 29.8395 35.644001 41.448502 44.355499 48.050999 53.333 59.137501 61.7785 67.583 71.278503 76.560501"
         y="23.997"
         id="tspan184">nakke og skuldre.</tspan><tspan
         x="0 6.3365002 10.032 15.8365 21.641001 27.445499 32.727501 38.532001 41.438999 46.721001 50.4165 56.221001 61.502998 64.143997 69.948502 75.230499 78.926003 81.833 84.473999 90.278503 95.560501 101.365 107.1695 112.4515 120.897 123.804 126.445 129.35201 134.634 138.3295 141.2365 144.93201 150.7365 153.3775 156.01849 161.823 165.51849 168.42551 172.121 177.403 185.8485 191.653 197.4575 200.3645 208.81 214.092 219.8965"
         y="35.995499"
         id="tspan186">Kroppen arbejdes igennem i et roligt tempo med </tspan><tspan
         x="0 3.6954999 12.141 17.423 20.33 26.134501 29.83 38.275501 42.4935 45.134499 48.830002 54.112 57.019001 62.823502 68.105499 72.855499 81.301003 87.105499 92.387497 95.028503 98.723999 104.006 107.7015 110.6085 114.304 116.945 119.586 123.2815 128.56351 132.259 135.9545 141.2365 144.93201 147.839 153.64349 158.92551 164.73 167.63699 172.91901 178.7235 184.00549 189.28751 191.9285 195.62399 200.90601 203.547"
         y="47.993999"
         id="tspan188">små præcise bevægelser tilrettet den enkelte. </tspan><tspan
         x="0 6.1673999 8.8084002 11.7154 14.3564 19.638399 24.388399 29.670401 33.365898 36.2729 42.0774 47.881901 51.5774 56.859402 59.766399 65.048401 68.743896 74.025902 79.830399 83.525902 86.166901 91.971397 97.775902 101.4714 105.1669 108.8624 117.3079 123.1124 125.7534 131.55791 137.3624 140.26939 146.0739 151.8784 154.7854 160.0674 163.76289 167.4584 170.0994 175.9039 179.5994 183.29491 188.5769 192.2724 195.1794 200.4614 203.1024 206.7979 209.4389 215.24339"
         y="59.9925"
         id="tspan190">Vi laver også kredsløbstræning og afslutter altid </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 28.2435 34.048 37.7435 41.438999 45.134499 53.580002 58.862 61.502998 64.410004 71.268997 77.073502 79.7145 85.518997 90.801003 94.496498 97.403503 102.6855 106.381 109.288 114.57 120.3745 126.179 129.086 132.78149 138.586 142.28149 145.18851 153.634 162.0795 167.884 173.68851 176.3295"
         y="71.990997"
         id="tspan192">med udstræk. Holdet er kun for mænd. </tspan></text>

    <text
       xml:space="preserve"

       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"

         y="0"
         id="tspan222">Motionsgymnastik</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,62.3524,262.5896)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text242"><tspan
         x="0 4.9314499 7.5724502 10.21345 13.12045 21.56595 27.370449 31.06595 33.706951 39.511452 45.315948 49.011452 54.815948 59.565948 68.011452 73.815948 79.097954 82.793449 86.488953 89.129951 94.411949 97.318947 101.01445 106.29645 109.99195 112.89895 118.70345 124.50795 127.41495 131.11044 134.80595 143.25145 149.05595 154.33795 158.03345 160.94044 166.74495 172.02695 174.66795 179.94995 182.85695 188.13895 191.83446 197.63895 203.44345 209.24796 214.52995 220.33446 222.97545 225.88245 229.57796 234.85995"
         y="0"
         id="tspan226">Til motionsgymnastik får du trænet hele kroppen, så </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 19.798 25.602501 28.2435 30.884501 35.634499 40.9165 44.612 47.519001 51.2145 54.91 63.355499 67.051003 72.333 75.239998 81.044502 86.848999 89.755997 93.4515 101.897 104.538 110.3425 112.9835 118.788 121.429"
         y="11.9985"
         id="tspan228">den bliver stærk og smidig. </tspan><tspan
         x="0 5.8729 11.6774 15.3729 20.6549 24.350401 27.257401 33.061901 36.757401 42.561901 48.366402 54.170898 56.811901 62.616402 67.898399 70.805397 76.609901 82.414398 87.164398 92.446404 96.141899 104.5874 110.3919 113.0329 118.8374 124.6419 127.5489 131.2444 139.6899 143.38541 147.0809 152.3629 156.0584 158.96539 164.7699 170.0519 175.8564 181.6609 184.5679 187.20889 190.11591 195.3979 199.0934 204.3754 210.1799 213.8754"
         y="23.997"
         id="tspan230">Vores grundige opvarmning sætter gang i kreds­</tspan><tspan
         x="0 2.641 8.4455004 14.25 19.532 23.227501 26.134501 31.938999 37.7435 40.650501 46.455002 51.737 57.5415 63.346001 68.627998 77.073502 82.355499 86.051003 91.855499 97.137497 99.778503 105.583 110.865 114.5605 117.4675 122.7495 125.3905 128.03149 133.31351 136.2205 144.666 150.4705 154.166 159.448 162.089 167.371 171.0665 173.9735 179.778 185.5825 188.4895 191.13049 196.41251 202.217 204.858 207.765 213.9324 216.57339"
         y="35.995499"
         id="tspan232">løbet og gennemarbejder alle muskler og led. Vi </tspan><tspan
         x="0 5.2820001 8.9775 14.782 20.063999 22.705 28.509501 33.7915 37.487 40.394001 46.198502 51.480499 54.121498 59.4035 62.310501 67.592499 71.288002 77.092499 82.897003 88.7015 93.983498 99.788002 102.695 105.336 111.1405 116.4225 122.227 128.03149 133.31351 141.759 144.666 148.3615 151.0025 153.64349 156.55051 162.355 168.1595 173.964 176.871 185.3165 191.121 194.8165 197.4575 202.7395 205.38049 208.28751 211.983 217.265 220.172 225.9765 231.2585 234.95399"
         y="47.993999"
         id="tspan234">arbejder hele kroppen igennem til god musik, så der </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.08 30.362 36.1665 44.612 53.057499 58.3395 62.035 64.942001 68.637497 73.387497 78.669502 84.473999 87.380997 93.185501 98.467499 101.3745 107.179 112.461 118.2655 124.07 129.35201 135.15649 138.06351 143.868 149.6725 152.5795 156.27499 164.7205 167.3615 170.0025 172.9095 178.714 183.996 186.903 189.54401 197.9895 203.79401 209.076 214.88049 217.5215"
         y="59.9925"
         id="tspan236">både kommer sved på panden og smil på læben. </tspan><tspan
         x="0 6.8590002 12.6635 18.468 23.75 27.445499 32.195499 34.836498 38.532001 44.336498 46.977501 52.782001 58.586498 63.8685 69.672997 72.580002 77.862 81.557503 85.252998 87.893997 93.698502 97.393997 101.0895 106.3715 110.067 112.974 121.4195 126.7015 132.506 135.41299 141.2175 144.91299 150.7175 156.522 162.32651 164.9675 170.772 173.679 179.48351 185.28799 188.98351 192.679 196.3745 204.82001 210.10201 215.90649 218.5475 224.35201 230.15649 232.7975"
         y="71.990997"
         id="tspan238">Undervisningen afsluttes med grundig udstrækning. </tspan><tspan
         x="0 6.8590002 9.5 12.141 17.423 20.33 25.612 30.893999 36.698502 39.605499 45.41 50.692001 53.333 57.0285 62.310501 68.114998 73.397003 76.304001 81.054001 83.960999 87.656502 92.938499 98.742996 104.025 107.7205 110.6275 114.323 120.1275 123.823 126.73 132.5345 137.8165 143.621 147.3165 149.9575 155.76199 161.5665 164.2075 167.903 171.5985 176.88049 179.70296"
         y="83.989502"
         id="tspan240">Alle kan deltage – rabat for pensionister.</tspan></text>

         y="0"
         id="tspan274">Dette er det helt rigtige hold for alle kvinder og </tspan><tspan
         x="0 8.4455004 16.891001 22.695499 28.5 31.141001 34.048 39.852501 45.134499 48.830002 51.737 56.487 59.127998 61.769001 64.676003 69.426003 74.708 80.512497 83.153503 85.794502 91.598999 96.880997 102.6855 108.49 111.131 116.9355 122.2175 125.1245 130.40649 134.10201 139.90649 145.711 151.5155 156.7975 162.60201 165.243 168.14999 171.8455 177.64999 181.3455 186.6275 192.43201 197.18201 202.9865 208.791 214.073"
         y="11.9985"
         id="tspan276">mænd, der vil vedligeholde kroppen, forebygge </tspan><tspan
         x="0 3.6954999 8.9775 14.2595 20.063999 25.346001 28.169399 30.8104 33.7174 39.5219 44.803902 50.608398 56.412899 62.2174 65.912903 69.608398 78.053902 83.858398 89.140404 92.047401 97.329399 103.1339 106.0409 109.7364 114.4864 119.7684 125.5729 128.4799 132.1754 136.9254 142.7299 145.6369 150.9189 153.55991 156.2009 161.48289 165.17841 168.0854 173.88989 179.6944 184.97639 187.88341 193.16541 196.8609 202.66541 208.46989 212.16541"
         y="23.997"
         id="tspan278">skader, genoptræne en svag ryg eller øge krops­</tspan><tspan

         y="35.995499"
         id="tspan280">bevidstheden.</tspan><tspan
         x="0 4.75 10.032 12.939 18.7435 24.025499 26.6665 31.9485 34.855499 40.137501 43.833 49.637501 55.442001 61.246498 66.528503 72.333 75.239998 79.989998 85.272003 88.967499 97.413002 102.695 106.3905 109.2975 115.102 120.9065 123.8135 129.618 135.4225 138.3295 143.6115 147.30701 153.1115 158.39349 161.0345 166.839 172.121 175.8165 178.7235 181.3645 187.16901 192.451 198.25549 204.06 209.342 217.78751 220.6945 223.33549"
         y="47.993999"
         id="tspan282">Få hele kroppen varmet op og arbejdet igennem i </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 15.58 20.862 29.307501 35.112 40.9165 43.557499 46.4645 50.16 55.9645 64.410004 67.317001 73.121498 78.926003 81.833 87.637497 92.919502 98.723999 104.006 106.913 112.195 117.477 123.2815 126.1885 129.884 135.68851 138.3295 144.134 149.416 152.323 160.76849 166.05051 171.855 174.76199 177.403 180.31 186.1145 191.91901 194.826 198.5215 201.16251 206.967 212.7715 218.0535"
         y="59.9925"
         id="tspan284">et tempo, som du både kan følge med i og finde </tspan><tspan
         x="0 5.8045001 11.609 15.3045 21.108999 24.804501 30.608999 34.304501 36.945499 42.75 48.554501 53.836498 57.532001 60.438999 63.080002 65.721001"
         y="71.990997"
         id="tspan286">udfordringer i. </tspan></text>

    <text

       id="text334"><tspan
         x="0 6.8590002 12.6635 15.3045 21.108999 26.391001 30.0865 32.9935 38.275501 41.971001 44.877998 48.573502 54.377998 58.073502 60.980499 66.262497 68.903503 71.544502 76.8265 79.467499 82.374496 88.179001 93.460999 97.156502 100.0635 105.868 111.6725 115.368 120.65 125.932 129.6275 132.5345 137.8165 141.51199 144.41901 148.1145 153.91901 157.6145 163.41901 168.701 174.50549 178.201 183.483 186.39 192.1945 197.4765 201.172 206.45399 210.14951"
         y="0"
         id="tspan320">Holdet er for alle, der ønsker at forbedre deres </tspan><tspan
         x="0 3.6954999 12.141 14.782 20.5865 23.227501 29.032 34.836498 40.1185 45.923 48.563999 51.471001 55.1665 58.862 63.612 67.307503 72.5895 77.871498 80.512497 83.419502 89.223999 94.505997 97.147003 102.429 108.2335 112.4515 117.7335 120.6405 126.445 132.2495 135.15649 140.43851 144.134 149.93851 155.743 159.43851 165.243 170.52499 175.27499 177.916 183.7205 187.416 191.1115 196.916 202.198 208.0025 210.64349"
         y="11.9985"
         id="tspan322">smidighed, styrke, balance og kropsbevidsthed. </tspan><tspan
         x="0 6.8590002 12.141 17.945499 23.75 29.032 37.477501 40.384499 46.188999 49.884499 55.688999 61.4935 67.297997 69.939003 78.384499 84.189003 89.9935 95.275497 101.08 106.8845 112.1665 115.0735 119.8235 125.628 131.4325 136.71449 140.41 144.1055 146.74651 149.3875 152.0285 154.66949 160.474 166.2785 171.5605 175.256 178.16299 183.9675 189.772 192.679 198.48351 203.23351 209.03799 214.8425 220.1245"
         y="23.997"
         id="tspan324">Gennem grundlæggende yogastillinger og dybde­</tspan><tspan
         x="0 5.2820001 8.9775 12.673 18.477501 26.923 32.727501 38.532001 41.173 46.977501 52.782001 55.688999 58.330002 66.775497 70.471001 75.752998 79.448502 82.355499 88.160004 93.9645 96.871498 102.676 105.317 111.1215 114.0285 119.3105 123.006 128.8105 134.61501 138.3105 141.2175 144.91299 147.554 153.35851 159.16299 164.44501 167.086 172.368 176.06351 178.9705 184.77499 190.05701 195.8615 199.55701 204.839"
         y="35.995499"
         id="tspan326">afspænding lærer du din krops signaler bedre </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.1665 22.4485 28.253 34.057499 39.3395 41.980499 44.887501 48.583 53.865002 56.771999 62.5765 67.858498 71.554001 74.460999 78.156502 83.438499 88.720497 94.525002 99.806999 103.5025 106.4095 111.6915 117.496 120.403 126.2075 132.01199 137.29401 140.9895 143.8965 149.701 154.983 157.62399 162.90601 168.71049 172.9285 178.21049 181.11749 189.563 194.845 197.48599 200.127 205.409 213.85451"
         y="47.993999"
         id="tspan328">at kende, så der skabes en øget balance mellem </tspan><tspan
         x="0 5.2820001 8.9775 14.782 20.5865 23.4935 29.298 35.102501 38.009499 41.705002 44.346001 50.150501 55.955002 58.596001 61.502998 70.471001 75.752998 78.393997 83.676003 87.371498 90.278503 95.560501 99.255997 102.163 107.445 111.1405 114.0475 117.743 121.4385 126.1885 129.884 135.166 140.448 143.355 148.63699 152.3325 158.13699 163.9415 169.746 175.028 180.8325 183.4735 186.38049 189.0215 194.826 198.5215 204.326 209.608"
         y="59.9925"
         id="tspan330">krop og sind. Målet er at styrke kroppen, løsne </tspan><tspan
         x="0 3.6954999 9.5 17.945499 23.75 29.554501 32.195499 38 43.804501 49.086498 51.908951 54.54995 57.456951 61.152451 66.956947 70.652451 75.934448 81.738953 86.488953 92.293449 98.097954 103.37995 106.28695 109.98245 113.67795 117.37345 122.65545 126.35095 130.04645 132.95345 138.75795 144.56245 147.46945 151.16495 156.44695 161.72894 167.53345 172.81544 175.72244 181.00446 186.80894 189.71594 192.35695 198.16145 203.96594 207.66145 212.94345 215.85045 219.54594 225.35045 227.99146"
         y="71.990997"
         id="tspan332">spændinger, forebygge stress og skabe en indre ro. </tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,328.8091,410.1526)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text382"><tspan
         x="0 6.8590002 12.141 15.8365 21.641001 27.445499 30.0865 34.304501 37.211498 42.4935 46.188999 49.096001 51.737 57.5415 61.237 66.518997 72.323502 76.018997 78.926003 82.621498 86.317001 94.762497 100.567 103.208 109.0125 114.817 117.724 123.5285 129.33299 132.24001 138.04449 140.6855 145.9675 151.772 154.679 163.1245 168.929 172.6245 175.2655 181.07001 186.8745 189.5155 192.4225 198.29445 204.09895 207.79445 213.07645 216.77196"
         y="0"
         id="tspan366">Aerobic er intens træning og glad motion. Vores </tspan><tspan
         x="0 5.8045001 10.5545 15.8365 19.532 23.227501 28.509501 31.4165 36.698502 41.980499 45.675999 51.480499 57.285 59.925999 64.143997 69.948502 75.752998 78.393997 84.198502 87.105499 92.387497 96.083 98.989998 104.272 107.9675 110.8745 116.1565 120.9065 123.5475 129.35201 135.15649 140.43851 146.243 152.0475 154.68851 160.493 163.134 166.041 171.8455 176.5955 182.39999 186.0955 189.0025 194.80701 200.6115 203.51849 207.214 212.496 216.1915"
         y="11.5045"
         id="tspan368">nyeste aerobichold er et kvindehold, hvor du får </tspan><tspan
         x="0 5.8045001 11.609 14.25 17.945499 23.227501 29.032 31.938999 37.7435 43.548 46.455002 52.259499 58.063999 60.971001 66.775497 70.471001 78.916496 84.721001 90.525497 95.807503 99.502998 102.41 107.692 112.974 115.615 121.4195 125.115 127.756 133.03799 136.73351 139.6405 144.9225 148.618 151.259 154.166 162.6115 167.89349 173.698 177.39349 180.30051 186.105 191.9095 194.8165 200.621 205.903 209.5985"
         y="23.009001"
         id="tspan370">pulsen op og brænder kalorier af, mens du har </tspan><tspan
         x="0 5.8045001 11.0865 14.782 17.688999 21.384501 24.025499 29.83 34.580002 38.275501 40.9165 43.823502 50.682499 56.487 62.2915 67.573502 71.268997 76.018997 78.660004 82.355499 88.160004 90.801003 96.605499 102.41 107.692 113.4965 116.4035 120.099 123.7945 129.07651 132.772 136.4675 141.7495 145.44501 148.35201 156.7975 162.0795 167.884 170.791 173.43201 178.714 182.4095 185.3165 191.121 196.403 202.2075 205.903 211.185"
         y="34.5135"
         id="tspan372">det sjovt. Undervisningen starter med let danse­</tspan><tspan
         x="0 5.2820001 10.564 14.2595 20.063999 25.8685 28.509501 32.727501 35.634499 39.330002 45.134499 53.580002 56.487 62.2915 68.096001 72.846001 78.127998 81.823502 90.268997 96.073502 98.7145 104.519 110.3235 112.9645 115.8715 118.5125 124.317 130.12151 135.4035 141.20799 144.11501 148.86501 151.506 154.41299 160.2175 165.4995 169.19501 172.10201 174.743 177.64999 183.4545 188.7365 194.541 200.3455"
         y="46.018002"
         id="tspan374">aerobic som opvarmning, inden vi går i gang </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 26.134501 29.83 34.580002 38.275501 43.557499 48.8395 52.002998 54.91 60.7145 66.518997 69.426003 75.230499 80.512497 83.153503 88.435501 94.239998 98.458 103.74 109.5445 114.2945 119.5765 122.2175 125.913 131.19501 134.8905 137.7975 143.60201 149.40649 152.31351 156.009 158.64999 164.4545 169.2045 172.1115 180.55701 186.3615 190.05701 195.339 200.621 203.26199 206.42551"
         y="57.522499"
         id="tspan376">med styrke­ og balanceøvelser og sjov muskel­ </tspan><tspan
         x="0 5.8045001 11.609 14.516 19.798 25.602501 31.407 37.211498 39.852501 43.548 46.188999 51.9935 57.798 61.4935 65.189003 68.884499 77.330002 83.134499 85.775497 91.580002 97.384499 100.0255 102.9325 107.86395 110.50495 118.95045 124.23245 130.03696 132.94395 136.63945 139.28046 145.08495 148.78046 152.47595 157.75795 161.45345 164.36044 169.64246 172.28345 175.97894 178.61995 184.42445 187.33145 195.77695 201.05894 206.86345"
         y="69.027"
         id="tspan378">og konditionstræning. Timen slutter altid med </tspan><tspan
         x="0 5.8045001 11.609 15.3045 19 22.695499 31.141001 36.423 42.227501 44.8685 50.673 56.477501"
         y="80.531502"
         id="tspan380">udstrækning.</tspan></text>

         y="0"
         id="tspan414">Vi starter timen med stræk og rulninger, der </tspan><tspan
         x="0 5.8045001 8.4455004 13.1955 18.477501 22.173 25.08 29.83 35.112 38.807499 47.252998 52.535 55.442001 58.083 60.990002 66.794502 72.0765 74.717499 79.999496 82.906502 88.188499 91.884003 97.688499 103.493 109.2975 114.5795 120.384 123.025 125.932 131.7365 137.01849 142.823 148.105 151.80051 155.496 160.778 164.4735 167.38049 172.66251 176.358 182.16251 187.4445 190.08549 195.89 201.172 204.86749"
         y="11.9985"
         id="tspan416">giver varme i hele kroppen. Bagefter arbejder </tspan><tspan
         x="0 4.75 7.3909998 10.298 18.7435 24.025499 29.83 32.737 38.019001 41.7145 47.519001 53.323502 59.127998 64.410004 70.2145 73.910004 76.817001 80.512497 86.317001 90.012497 93.708 98.989998 104.272 106.913 109.554 112.195 117.9995 123.2815 126.1885 134.634 140.43851 144.134 149.416 154.698 157.339 163.14349 166.839 172.64349 178.448 184.2525 189.5345 192.35695 194.99796 197.90495 201.60045 206.88245"
         y="23.997"
         id="tspan418">vi med kroppens forskellige muskelgrupper, så </tspan><tspan
         x="0 5.8045001 11.0865 15.8365 24.282 30.0865 35.3685 38.009499 40.650501 46.455002 52.259499 57.5415 63.346001 68.627998 74.432503 77.3395 83.143997 88.948502 94.230499 97.926003 100.567 103.474 110.333 116.1375 119.0445 124.3265 129.60851 135.41299 138.32001 142.0155 147.2975 149.93851 154.68851 157.5955 163.39999 168.68201 172.3775 176.073 181.355 189.80051 198.246 203.528 206.16901"
         y="35.995499"
         id="tspan420">bevægeligheden øges. Du kan selv bestemme, </tspan><tspan
         x="0 5.8045001 10.5545 16.358999 20.054501 22.9615 28.766001 34.570499 38.265999 44.070499 47.765999 53.570499 57.265999 62.548 68.352501 74.156998 79.439003 82.346001 88.150497 93.432503 97.127998 100.035 103.7305 109.0125 114.2945 116.9355 119.8425 124.5925 133.03799 136.73351 142.0155 144.65649 147.56351 152.8455 155.4865 159.18201 162.089 167.371 171.0665 176.871 185.3165 191.121 196.92551 199.5665 205.371 208.278 213.56 217.25549"
         y="47.993999"
         id="tspan422">hvor udfordrende det skal være, alt afhængig af </tspan><tspan
         x="0 5.8045001 8.4455004 14.25 17.157 22.438999 28.2435 33.525501 39.330002 42.237 47.519001 53.323502 59.127998 64.932503 67.573502 71.268997 73.910004 79.7145 85.518997 88.160004 91.067001 94.762497 98.458 103.208 106.9035 112.1855 117.4675 120.3745 126.179 131.98351 134.8905 140.69501 144.3905 150.19501 155.9995 158.90649 164.18851 167.884 170.791 174.4865 179.76849 185.573 189.26849 194.55051 199.8325 205.63699 210.91901 214.6145"
         y="59.9925"
         id="tspan424">din egen kondition, styrke og brug af redskaber </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 26.134501 28.775499 34.057499 37.752998 41.448502 44.0895 49.371498 54.6535 59.935501 63.631001 66.538002 72.342499 78.147003 81.054001 86.858498 92.140503 97.945 103.7495 108.4995 116.945 122.7495 126.445 131.72701 134.368 137.27499 144.134 146.77499 149.416 154.698 157.605 162.88699 168.16901 173.9735 176.88049 182.685 187.967 190.608 194.3035 199.58549 205.39 210.672 213.313 216.22 222.02451 227.82899"
         y="71.990997"
         id="tspan426">som elastikker og håndvægte. Alle kan deltage, og </tspan><tspan
         x="0 3.6954999 7.3909998 15.8365 21.641001 24.282 30.0865 35.890999 41.173 46.977501 49.884499 52.525501 57.807499 63.612 68.893997 72.5895 75.496498 80.778503 84.473999 87.380997 92.663002 98.467499 101.3745 105.07 109.82 113.5155 116.1565 121.961 125.6565 130.93851 134.634 139.916 145.7205 151.0025 156.80701 160.5025 163.14349 166.05051 169.746 175.55051 183.996 186.903 190.5985 193.2395 195.88049 201.685 206.967 210.66251 214.358 219.64 223.33549"
         y="83.989502"
         id="tspan428">træningen ledes af en fysioterapeut, som tilpasser </tspan><tspan
         x="0 5.8045001 10.5545 15.8365 18.477501 22.173 27.455 31.150499 36.955002 42.237 45.144001 48.8395 51.480499 54.121498 57.0285 62.833 68.114998 73.919502 76.8265 82.108498 87.913002 93.195 98.476997 101.118 104.8135 110.0955 113.791 116.698 122.5025 125.1435 129.89349 135.17551 140.4575 146.26199 148.903"
         y="95.987999"
         id="tspan430">øvelserne til den enkeltes niveau. </tspan></text>

         id="tspan48">Denne flotte og velholdte villa byder på fire gode </tspan><tspan
         x="0 4.75 13.1955 16.891001 22.173 24.813999 28.509501 33.7915 36.614899 39.255901 42.162899 45.858398 51.662899 54.569901 60.374401 65.656403 68.297401 70.9384 73.579399 79.383904 84.665901 87.572899 93.377403 98.659401 104.4639 109.7459 114.4959 122.9414 126.6369 131.9189 134.55991 138.2554 143.5374 146.36079 149.0018 151.9088 157.1908 160.88631 163.7933 169.0753 174.87981 180.1618 185.4438 190.7258 196.5303 199.6938 204.9758 207.61681 211.3123 217.11681 225.5623"
         y="12.502"
         id="tspan50">værelser, to dejlige badeværelser, et køkken­alrum </tspan><tspan
         x="0 3.6954999 8.9775 17.423 21.1185 24.025499 27.721001 33.525501 36.432499 40.127998 43.823502 49.627998 54.91 58.605499 61.512501 66.794502 72.598999 75.505997 79.2015 85.005997 87.647003 91.342499 96.624496 99.265503 102.1725 107.4545 113.259 116.166 121.9705 130.416 135.166 140.448 144.14349 147.05051 150.746 154.4415 162.88699 166.5825 171.8645 175.56 179.25549 184.53751 188.233 191.9285 197.21049 200.11749 205.922 211.7265 214.6335 219.9155 225.72"
         y="25.004"
         id="tspan52">samt to stuer en suite, en hævet træterrasse og en </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 12.673 17.955 21.650499 26.932501 30.628 34.323502 39.605499 43.300999 46.996498 52.2785 54.919498 57.8265 63.108501 65.749496 71.031502 76.835999 82.640503 88.445 96.890503 105.336 110.618 116.4225 119.3295 121.9705 124.6115 130.416 136.2205 141.5025 145.198 148.105 153.9095 159.1915 162.0985 167.38049 173.185 176.092 179.78751 183.483 189.28751 192.983 195.89 201.6945 205.39 211.1945 216.99899 222.8035"
         y="37.506001"
         id="tspan54">fliseterrasse. Ejendommen ligger på en stor grund </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 27.721001 33.525501 36.432499 40.127998 45.932499 48.573502 52.269001 54.91 60.7145 63.621498 69.426003 74.708 79.458 84.739998 87.380997"
         y="50.007999"
         id="tspan56">med en solrig have. </tspan><tspan
         x="0 5.8045001 11.0865 13.7275 16.3685 22.173 27.977501 33.259499 39.063999 44.8685 50.150501 55.955002 61.237 67.041496 69.948502 75.230499 80.512497 86.317001 89.223999 91.864998 97.147003 102.429 107.711 110.618 116.4225 119.0635 121.7045 126.4545 131.7365 134.64349 143.089 148.371 154.17551 159.4575 163.153 166.06 171.8645 177.1465 182.951 186.6465 191.9285 194.83549 203.28101 208.563 214.36749"
         y="62.509998"
         id="tspan58">Beliggenheden kan ikke blive meget bedre med </tspan><tspan
         x="0 5.2820001 7.9229999 10.564 15.846 18.753 22.4485 27.730499 31.9485 34.5895 37.230499 39.871498 43.567001 48.848999 52.544498 57.8265 61.521999 64.429001 67.07 69.976997 75.781502 81.063499 86.867996 92.672501 95.313499 100.5955 106.4 111.682 115.3775 118.0185 120.9255 126.73 129.371 132.01199 137.29401 139.935 142.842 146.53751 151.8195 157.62399 160.265 165.547 168.188 171.095 176.89951 182.70399 188.5085 193.7905"
         y="75.012001"
         id="tspan60">alle faciliteter i nabolaget, bl.a. skole, gode </tspan><tspan

         id="tspan112">dejlige villa, der byder velkommen i en lys entré </tspan><tspan

         y="25.004"

         id="tspan118">stue har udgang til en høj terrasse samt åbent til </tspan><tspan

         y="87.514"
         id="tspan124">en god kælder med vaskerum og festlokale. </tspan><tspan

         y="100.016"
         id="tspan126">Der er gåafstand til Køges hyggelige torv og </tspan><tspan

         y="12.502"
         id="tspan150">velholdt med helt nye vinduer. I kan se frem til et </tspan><tspan
         x="0 2.641 11.0865 16.3685 21.650499 26.932501 30.628 34.323502 37.230499 42.512501 48.317001 53.598999 58.881001 64.163002 69.967499 72.608498 75.515503 80.797501 86.601997 89.509003 92.150002 96.900002 100.5955 103.5025 107.198 110.8935 116.698 121.98 124.621 127.528 131.2235 133.8645 137.56 142.842 145.74899 151.5535 156.83549 159.4765 162.11749 164.7585 170.563 175.845 178.752 183.502 191.94749 195.64301 200.925 203.56599 207.26151 212.5435 215.36595 218.00694"
         y="25.004"
         id="tspan152">lækkert køkken, en lys stue, fire dejlige værelser, </tspan><tspan

         y="37.506001"
         id="tspan154">et stort badeværelse med badekar samt kælder </tspan><tspan

         y="50.007999"
         id="tspan156">med tre disponible rum. Til haven hører et delvist </tspan><tspan
         x="0 5.8045001 10.5545 15.8365 19.532 25.3365 33.782001 39.063999 44.346001 49.627998 53.323502 56.230499 59.925999 65.208 68.903503 72.598999 77.880997 81.5765 85.272003 90.554001 98.999496 101.6405 104.2815 106.9225 112.727 115.634 124.0795 129.3615 135.166 138.073 143.8775 149.68201 154.964 160.246 166.05051 171.3325 176.6145 181.8965 187.701 190.342 193.24899 195.89"
         y="62.509998"
         id="tspan158">overdækket terrassemiljø med udekøkken. I </tspan><tspan
         x="0 5.8045001 11.609 15.3045 23.75 27.445499 31.141001 36.423 40.1185 43.025501 45.6665 50.948502 54.644001 57.550999 61.769001 67.051003 72.855499 76.551003 80.246498 85.528503 88.169502 91.864998 94.772003 103.2175 108.4995 114.304 117.211 123.0155 128.2975 133.5795 137.27499 140.9705 144.666 149.948 155.7525 161.55701 164.464 168.1595 170.80051 173.4415 176.3485 180.04401 185.326 191.13049 193.7715 199.0535 201.6945"
         y="75.012001"
         id="tspan160">bosætter jer centralt med gåafstand til skole, </tspan><tspan
         x="0 5.8045001 11.609 15.3045 21.108999 26.391001 32.195499 37.477501 42.227501 47.509499 50.4165 56.221001 62.025501 64.932503 69.682503 74.432503 81.823502 84.4645 87.371498 94.230499 99.512497 103.208 106.115 111.397 115.0925 117.9995 123.804 129.086 131.72701 134.368 139.64999 143.3455 146.2525 148.89349 154.17551 159.4575 164.7395 167.6465 170.28751 175.5695 181.37399 187.1785 190.87399 193.78101 197.4765 200.11749 202.7585"
         y="87.514"
         id="tspan162">børnehave og SFO. Der er heller ikke langt til </tspan><tspan
         x="0 8.4455004 14.25 17.945499 23.75 27.445499 32.195499 37.477501 40.1185 45.400501 51.205002 54.112 62.557499 68.362 74.166496 77.073502 83.410004 89.2145 95.018997 100.301 106.1055 111.91 117.192 121.942 127.7465 130.3875"
         y="100.016"

         y="0"
         id="tspan180">I skønne rolige omgivelser udbydes denne dejlige </tspan><tspan

         y="12.502"
         id="tspan182">rummelige villa med flot have. I får bl.a. tre stuer, </tspan><tspan

         y="25.004"
         id="tspan184">tre værelser foruden et helt nyt badeværelse med </tspan><tspan
         x="0 2.641 7.3909998 11.0865 16.3685 19.275499 24.557501 27.1985 29.8395 35.644001 40.925999 46.208 49.9035 52.810501 58.615002 64.419502 67.3265 75.772003 81.5765 85.272003 90.554001 94.249496 97.156502 102.961 106.6565 112.461 116.1565 121.4385 127.243 129.884 134.10201 139.90649 145.18851 147.8295 150.7365 156.01849 159.714 162.621 166.3165 170.01199 175.8165 179.51199 183.2075 186.1145 191.91901 197.201 203.00549 208.28751 211.983 217.78751 226.233"
         y="37.506001"
         id="tspan186">lyse klinker og muret bruseniche, et stort baderum </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 27.188999 32.471001 36.1665 41.448502 46.730499 50.425999 56.230499 58.871498 61.512501 66.794502 69.7015 75.505997 81.310501 84.217499 89.499496 93.195 96.101997 101.9065 110.352 114.0475 117.743 123.025 126.7205 132.52499 135.166 137.80701 143.089 146.7845 149.42551 152.3325 161.30051 166.5825 172.38699 175.29401 177.935 180.842 186.12399 191.9285 197.733 203.015 206.71049 209.61749 213.313 218.595 222.2905 225.19749 227.8385"
         y="50.007999"
         id="tspan188">med vaskesøjle og et gæstetoilet. Med i købet får I </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 15.58 19.275499 25.08 28.775499 32.471001 35.377998 41.182499 46.987 52.7915 58.596001 62.2915 65.198502 71.002998 76.807503 79.7145 84.996498 90.801003 93.708 97.926003 103.208 106.9035 112.708 118.5125 122.208 125.9035 128.54449"
         y="62.509998"
         id="tspan190">et stort udhus og en carport. </tspan><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 23.4935 28.775499 31.4165 35.112 40.394001 44.0895 46.996498 50.692001 53.333 55.973999 58.615002 63.896999 69.7015 74.983498 78.679001 81.585999 87.390503 92.672501 96.367996 99.009003 101.916 107.198 112.48 118.2845 121.1915 123.8325 126.7395 130.435 134.13049 142.576 147.858 153.14 158.422 161.32899 167.1335 172.938 175.845 181.64951 186.9315 189.8385 195.64301 200.925 206.72951 209.63651 213.332 217.0275 222.832 226.5275 231.80949"
         y="75.012001"
         id="tspan192">Når vejret tillader det, kan I trække ud på den store </tspan><tspan
         x="0 3.6954999 7.3909998 15.8365 19.532 24.813999 28.509501 32.205002 37.487 41.182499 44.877998 50.16 53.067001 55.708 58.615002 64.419502 70.223999 73.919502 79.2015 82.897003 86.592499 89.499496 93.195 98.999496 101.6405 105.336 107.977 113.7815 119.0635 121.9705 127.775 133.05701 137.80701 143.089 145.996 154.4415 159.7235 165.528 168.435 173.717 179.5215 182.4285 185.0695 190.3515 196.15601 201.438 206.188 211.47 217.27451 219.9155 222.5565 228.36099"
         y="87.514"
         id="tspan194">træterrasse i husets solrige have med en legevenlig </tspan><tspan
         x="0 5.8045001 9.5 17.945499 21.641001 27.445499 30.0865 38.532001 44.336498 49.6185"

         y="0"
         id="tspan212">Villa beliggende i rolige omgivelser i landsbyen </tspan><tspan

         y="12.502"
         id="tspan214">Lidemark, tæt på Valløskovene, og med plads til den </tspan><tspan

         id="tspan218">Stueplan rummer stue og køkken i åben forbindelse </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 28.2435 30.884501 34.580002 39.862 45.144001 48.8395 54.121498 57.0285 62.833 68.637497 74.442001 79.723999 85.528503 91.333 94.239998 97.935501 100.5765 103.2175 106.1245 111.4065 117.211 120.118 125.9225 131.72701 137.53149 140.43851 146.243 152.0475 157.3295 161.02499 164.7205 170.52499 175.80701 178.448 181.355 188.214 193.496 197.1915 202.996 208.80051 214.0825 219.88699 222.79401 228.076 231.7715"
         y="50.007999"
         id="tspan220">med direkte udgang til en god udestue. Desuden er </tspan><tspan
         x="0 5.8045001 11.0865 14.782 17.688999 21.384501 25.08 30.362 33.269001 38.019001 46.4645 50.16 55.442001 58.083 61.7785 67.060501 69.883904 72.524902 75.4319 79.127403 84.9319 87.838898 91.534401 94.1754 99.979897 105.2619 108.1689 113.9734 119.2554 125.0599 130.3419 135.0919 143.5374 147.23289 152.51489 155.1559 158.85139 164.13341 166.9568 169.59779 172.50481 177.7868 181.4823 184.3893 190.1938 193.8893 198.6393 204.4438 210.24831 215.5303 219.2258 222.9213"
         y="62.509998"
         id="tspan222">der tre værelser, to fine badeværelser, et bryggers </tspan><tspan

       id="text118"><tspan
         x="0 6.8590002 10.5545 15.8365 20.5865 25.8685 31.673 34.580002 39.862 45.144001 47.785 50.692001 55.973999 61.256001 66.538002 71.82 74.726997 81.585999 86.867996 90.563499 96.367996 102.1725 105.868 108.775"
         y="0"
         id="tspan116">Graven 24, 8000 Aarhus C</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,711.5185)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text146"><tspan
         x="0 8.9680004 14.7725 18.468 23.75 29.554501 34.836498 38.532001 42.227501 47.509499 51.205002 54.112 60.448502 65.730499 69.426003 74.708 80.512497 83.419502 90.278503 96.083 99.778503 103.474 108.756 114.5605 117.4675 123.272 129.07651 131.98351 137.78799 143.5925 147.28799 149.929 153.6245 157.32001 159.961 165.243 171.0475 173.9545 178.7045 184.509 190.31351 196.118 201.39999 205.0955 208.0025 211.698 215.39349 220.67551 224.371"
         y="0"
         id="tspan120">Ægteparret Karen Husted og Christian Funder står </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 19.798 25.602501 28.2435 31.938999 37.221001 42.502998 48.307499 51.2145 53.855499 56.762501 62.567001 67.848999 73.653503 78.935501 82.630997 85.272003 90.554001 94.249496 97.156502 104.0155 106.8389 109.4799 112.3869 117.6689 122.9509 125.5919 128.4989 134.30341 139.5854 143.2809 146.1879 151.46989 155.16541 158.0724 163.87691 169.6814 174.96339 180.24541 182.8864 188.6909 192.3864 195.2934 200.57539 204.2709 207.9664 213.2484 216.94389"
         y="12.996"
         id="tspan122">bag disken i bageriet Nr. 24, der er opkaldt efter </tspan><tspan
         x="0 5.2820001 11.0865 14.782 20.063999 23.759501 27.455 32.737 38.5415 41.448502 47.252998 52.535 55.442001 62.300999 65.996498 71.278503 76.028503 81.310501 87.114998 90.022003 92.663002 95.57 100.32 105.602 109.2975 111.9385 117.743 123.025 126.7205 132.0025 136.7525 142.0345 145.73 149.42551 154.7075 158.403 163.685 167.38049 170.0215 172.9285 179.78751 185.592 190.342 195.62399 198.265 204.0695 209.3515 213.047"
         y="25.992001"
         id="tspan124">adressen på Graven i Latinerkvarteret. Udvalget </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 14.5255 19.807501 25.0895 30.3715 33.2785 36.973999 40.669498 46.473999 50.169498 53.865002 56.506001 59.412998 67.858498 73.140503 78.945 81.851997 87.656502 92.938499 98.742996 101.65 104.291 106.932 109.573 112.214 117.496 120.403 126.2075 132.01199 135.7075 138.3485 143.63049 146.53751 151.8195 155.515 158.422 164.2265 168.9765 174.78101 180.58549 185.86749 188.5085 191.14951 196.95399 199.595 202.502 208.3065 214.11099"
         y="38.987999"
         id="tspan126">er ikke stort, men den lille butik er hyggelig, og </tspan><tspan
         x="0 3.6954999 12.141 17.423 23.227501 28.509501 34.313999 37.221001 43.025501 48.830002 51.737 57.019001 62.823502 68.627998 72.323502 74.9645 78.660004 82.355499 87.637497 93.442001 97.137497 102.4195 108.224 111.131 116.413 120.1085 123.0155 128.82001 132.5155 138.32001 144.1245 149.40649 153.10201 156.009 161.291 164.9865 167.89349 171.589 176.871 182.67551 186.371 191.653 195.3485 199.04401 201.685 205.38049 210.66251 213.3035 216.21049 221.49249 225.188 230.99249 235.74249"
         y="51.984001"
         id="tspan128">smagen og konsistensen af brødet er fantastisk. Prøv </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.102501 21.384501 26.6665 30.362 35.644001 44.0895 49.894001 55.175999 57.817001 60.723999 66.528503 72.333 74.973999 77.614998 82.897003 86.592499 92.397003 97.679001 100.586 105.868 109.5635 112.4705 116.166 121.9705 127.2525 129.89349 133.589 136.496 141.778 144.41901 147.06 152.342 156.03751 158.9445 164.74899 167.39 172.672 178.4765 184.28101 187.9765 193.78101 198.53101 203.813 209.61749 214.89951 217.5405"
         y="64.980003"
         id="tspan130">for eksempel bollerne af spelt eller ølandshvede, </tspan><tspan
         x="0 5.8045001 9.5 15.3045 23.75 29.554501 38 41.695499 45.390999 51.195499 53.836498 57.532001 61.227501 66.509499 70.205002 76.009499 81.291496 84.198502 89.480499 92.121498 94.762497 100.0445 103.74 106.647 115.0925 120.897 124.5925 129.8745 135.679 140.961 144.65649 148.35201 153.634 157.3295 161.02499 163.93201 168.68201 173.964 177.6595 181.355 183.996 189.80051 195.605 198.51199 203.79401 207.4895"
         y="77.975998"
         id="tspan132">brombærsnitterne eller ægteparrets version af </tspan><tspan
         x="0 5.2820001 7.9229999 13.205 16.900499 20.596001 23.237 26.932501 32.2145 37.496498 40.4035 44.098999 49.9035 55.185501 60.990002 63.631001 68.913002 71.554001 74.460999 80.265503 85.547501 88.454498 92.150002 97.431999 102.714 107.996 110.637 116.4415 120.137 125.419 128.326 133.608 138.89 144.6945 149.9765 152.61749 156.313 158.95399 164.7585 170.563 173.20399 176.11099 182.97 188.77451 194.57899 197.22 202.502 208.3065 211.2135 214.909 217.55 220.19099"
         y="90.972"
         id="tspan134">klassiske snegle, de såkaldte kanelting. Nøglen til </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 19.798 25.602501 31.407 34.048 39.330002 42.237 47.519001 52.269001 57.550999 60.192001 62.833 66.528503 71.810501 75.505997 78.413002 83.695 87.390503 90.297501 92.938499 96.634003 102.4385 105.0795 110.884 116.166 119.073 121.714 127.5185 133.323 138.605 144.4095 149.6915 154.4415 159.7235 163.41901 169.2235 174.50549 177.1465 180.0535 185.33549 189.03101 191.938 197.22 199.86099 203.5565 206.4635 212.26801 215.9635 221.76801 227.57249"
         y="103.968"
         id="tspan136">den høje kvalitet er ifølge indehaverne, at alt brød </tspan><tspan

         y="116.964"
         id="tspan138">er lavet på surdej og hæver i 24 timer eller mere. </tspan><tspan
         x="0 6.8590002 12.6635 18.468 23.218 28.5 32.195499 35.102501 40.907001 44.602501 50.407001 56.211498 59.1185 64.922997 70.727501 73.634499 78.916496 84.198502 90.002998 95.285004 98.980499 101.8875 107.692 112.974 116.6695 119.5765 125.381 131.1855 134.881 137.522 142.804 148.086 153.368 159.1725 162.0795 167.3615 171.05701 173.964 176.605 179.246 181.88699 184.528 189.81 192.717 198.5215 204.326 209.076 214.358 216.99899 222.8035 225.71049 230.99249 234.688"
         y="129.96001"
         id="tspan140">Udover brød og kager har butikken et lille udvalg af </tspan><tspan

         y="142.95599"
         id="tspan142">ost, marmelade og forskellige meltyper, hvis du vil </tspan><tspan

         y="0"

         y="12.996"
         id="tspan158">de bløde müsliboller og de afhængighedsskabende </tspan><tspan

         y="25.992001"
         id="tspan160">kanelsnegle er sikre hits hos midtbybageren </tspan><tspan
         x="0 5.8045001 9.5 12.141 17.423 23.227501 27.445499 33.25 39.054501 41.695499 44.602501 50.407001 55.688999 59.384499 62.2915 68.096001 73.900497 77.596001 82.877998 85.785004 89.480499 92.121498 97.926003 100.567 103.208 109.0125 114.2945 117.99 123.272 126.179 131.98351 137.2655 142.0155 147.82001 153.10201 156.009 161.291 167.0955 170.0025 173.698 176.339 178.98 181.621 186.903 189.54401 192.451 198.25549 203.53751"
         y="38.987999"
         id="tspan162">Briancon, der også tidligere havde en filial på </tspan><tspan
         x="0 6.8590002 12.6635 17.4135 23.218 29.022499 31.6635 34.570499 39.149502 44.953999 48.649502 52.696499 55.337502 58.244499 64.411903 67.052902 69.9599 75.241898 81.046402 86.850899 92.132896 95.8284 101.1104 103.7514 109.0334 112.7289 115.6359 120.9179 124.6134 127.5204 131.2159 139.66141 144.94341 150.74789 156.02991 158.9369 164.74139 170.02341 173.7189 176.6259 179.26691 182.9624 188.2444 190.88541 193.5264 198.8084 204.6129 208.3084 213.59039 218.87241"
         y="51.984001"
         id="tspan164">Åbyhøj Torv. Vi anbefaler at smage det italienske </tspan><tspan

         y="64.980003"
         id="tspan166">durumbrød, der både fås som baguettes og i stor </tspan><tspan
         x="0 3.6954999 8.9775 17.423 20.063999 22.705 25.346001 30.628 34.323502 38.019001 43.823502 47.519001 51.2145 56.496498 59.137501 62.833 68.114998 70.755997 73.663002 79.467499 83.163002 85.804001 91.085999 96.890503 101.1085 106.913 112.7175 115.6245 121.429 126.711 130.40649 133.31351 138.5955 142.291 145.198 148.89349 152.589 158.39349 162.089 165.7845 168.6915 174.496 180.30051 185.05051 190.3325 192.9735 198.778 201.685 206.967 210.66251"
         y="77.975998"
         id="tspan168">familiestørrelse. Briancon har et stort udvalg af </tspan><tspan
         x="0 4.2179999 10.0225 15.3045 23.75 29.554501 34.836498 40.640999 46.445499 51.727501 55.423 58.330002 64.134499 69.939003 72.846001 78.650497 84.455002 87.096001 92.900497 98.182503 101.878 104.785 107.426 115.8715 120.6215 126.426 129.067 131.70799 137.5125 141.20799 144.11501 149.397 153.0925 156.78799 162.07001 167.8745 173.679 178.961 187.40649 192.68851 198.493 202.18851 207.4705 210.2939 212.93491 215.8419 221.64639 226.39639 232.2009 235.89639"
         y="90.972"
         id="tspan170">champagner og holder jævnligt arrangementer, hvor </tspan><tspan
         x="0 5.8045001 11.609 14.516 19.798 25.08 30.884501 33.7915 37.487 42.769001 45.675999 50.958 56.762501 59.669498 62.310501 68.114998 73.919502 77.614998 83.419502 87.114998 89.755997 95.560501 101.365 104.272 106.913 109.82 115.6245 121.429 127.2335 129.8745 135.15649 138.85201 144.65649 149.93851 153.634 156.541 161.291 166.573 170.26849 176.073 181.355 187.1595 190.0665 195.871 201.67551 204.5825 208.278 216.7235 222.00549 227.81 233.092"
         y="103.968"
         id="tspan172">du kan få en indføring i boblernes verden og smage </tspan><tspan

         y="0"
         id="tspan186">Den kombinerede bager og deli Mor Anna slog </tspan><tspan

         y="12.996"

         y="38.987999"
         id="tspan192">Arsenalet består af et velvalgt sortiment af </tspan><tspan

         y="51.984001"
         id="tspan194">fortrinligt brød og søde sager som tebirkes og </tspan><tspan

         y="64.980003"
         id="tspan196">hindbærsnitter, og butikken skyder også med skarpt </tspan><tspan

         y="77.975998"
         id="tspan198">med en stribe gode sandwiches, der er lige </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.1665 20.862 23.768999 27.4645 32.746498 38.550999 43.833 46.740002 55.185501 60.467499 66.272003 68.913002 71.82 77.101997 80.797501 86.601997 91.351997 94.259003 97.954498 103.759 107.4545 110.3615 115.6435 120.9255 124.621 129.903 138.3485 144.153 149.435 152.076 154.983 159.733 165.015 168.71049 171.3515 176.6335 182.438 186.1335 191.4155 197.22 200.127 208.57249 213.85451 219.659"
         y="90.972"
         id="tspan200">til at tage med. Prøv for eksempel varianten med </tspan><tspan
         x="0 3.6954999 9.5 13.1955 21.641001 27.445499 33.25 36.945499 39.852501 45.657001 50.938999 54.634499 59.9165 65.721001 69.416496 74.166496 77.862 81.557503 84.4645 92.910004 98.192001 103.9965 106.9035 110.599 116.4035 124.849 130.131 133.82651 136.4675 139.3745 143.07001 148.8745 154.679 159.961 163.65649 166.56351 170.78149 176.586 185.03149 188.72701 194.009 197.1725 202.97701 206.6725 210.368 213.009"
         y="103.968"
         id="tspan202">sprængt oksebryst med tomat, røget comté­ost, </tspan><tspan
         x="0 3.6954999 9.5 13.1955 18.477501 22.173 25.8685 28.509501 34.313999 40.1185 43.025501 48.830002 54.634499 57.5415 61.759499 67.564003 70.205002 72.846001 75.487 83.932503 89.2145 93.9645 99.768997 102.41"
         y="116.964"

         y="0"
         id="tspan266">Hos Småkagehuset på Frederiks Allé er det </tspan><tspan

         y="12.996"
         id="tspan268">selvfølgelig først og fremmest småkager, det </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.695499 25.3365 30.6185 34.313999 37.221001 43.025501 51.471001 54.112 57.019001 62.823502 68.627998 71.535004 77.3395 82.621498 85.528503 90.810501 94.505997 97.413002 101.1085 106.913 110.6085 114.304 117.9995 126.445 129.97044 133.66595 138.94795 141.58894 144.22995 150.03445 155.31645 157.95744 160.86446 169.83244 175.11446 180.91895 183.82594 189.63045 194.91245 200.71695"
         y="25.992001"
         id="tspan270">handler om, og de er fortræffelige. Men den </tspan><tspan
         x="0 2.641 5.2820001 7.9229999 10.564 15.846 18.753 24.557501 29.8395 35.644001 40.925999 44.621498 47.5285 53.333 58.615002 61.521999 66.272003 69.967499 75.249496 81.054001 86.335999 90.031502 92.672501 97.954498 101.65 107.4545 110.0955 115.3775 119.073 124.8775 127.7845 133.589 138.871 142.5665 145.4735 153.91901 159.201 162.8965 168.1785 171.08549 176.36749 182.172 187.9765 190.8835 194.57899 203.02451 208.3065 210.94749"
         y="38.987999"
         id="tspan272">lille bager på Frederiksbjerg har mere end små, </tspan><tspan
         x="0 5.2820001 11.0865 16.3685 20.063999 25.346001 31.150499 36.955002 42.237 45.144001 50.425999 55.708 61.512501 66.794502 70.489998 73.397003 78.679001 82.374496 85.281502 91.085999 95.835999 101.6405 106.9225 109.8295 115.634 120.916 123.557 126.464 132.63139 135.2724 138.1794 143.9839 152.4294 157.1794 162.9839 168.2659 171.9614 174.86839 177.5094 180.4164 184.11189 186.7529 195.19839 201.0029 206.8074"
         y="51.984001"
         id="tspan274">knasende kager at byde på. Vi nævner i flæng </tspan><tspan
         x="0 3.6954999 7.3909998 12.673 18.477501 24.282 29.032 34.836498 38.532001 44.336498 49.6185 55.423 59.1185 64.400497 67.307503 73.112 76.807503 82.612 88.416496 91.323502 97.127998 102.9325 105.8395 111.644 117.4485 120.0895 122.7305 128.0125 130.83591 133.4769 136.3839 140.07941 145.3614 153.8069 157.5024 162.78439 168.06641 173.3484 179.15289 184.43491 187.2583 189.89931"
         y="64.980003"
         id="tspan276">stenovnsbagte brød og boller, skærekager, </tspan><tspan
         x="0 3.6954999 7.9134998 13.718 19.522499 24.804501 28.5 31.141001 34.048 37.7435 46.188999 49.884499 53.580002 58.862 61.685398 64.326401 67.233398 70.928902 74.624397 79.906403 85.710899 89.406403 94.6884 99.970398 102.8774 107.6274 112.9094 116.6049 119.2459 124.5279 127.3513 129.99229 132.89931 136.5948 142.39931 148.2038 153.48579 157.1813 159.8223 163.51781 168.7998 174.0818 176.9888 182.2708 187.5528 191.07919 194.7747 200.0567 205.86121 209.5567 215.36121 221.1657 223.8067"
         y="77.975998"
         id="tspan278">scones, tærter, franske vafler, tunesiske kaffebrød, </tspan><tspan

         y="90.972"
         id="tspan280">muffins og marengskager. For slet ikke at tale </tspan><tspan

         y="103.968"
         id="tspan282">om kransekage, studenterbrød og kokossnitter. </tspan><tspan

         y="116.964"
         id="tspan284">Vi anbefaler, at du som minimum prøver </tspan><tspan
         x="0 4.2179999 10.0225 15.827 21.108999 26.9135 29.554501 34.836498 40.640999 45.923 49.6185 54.900501 63.346001 67.041496 72.323502 77.605499 82.887497 88.692001 93.973999 99.778503 102.6855 108.49 114.2945 117.2015 123.006 128.8105 132.506 135.147 140.429 145.711 150.993 156.7975 160.493 163.39999 167.0955 171.31351 177.118 182.9225 188.2045 191.89999 194.80701 203.2525 208.5345 214.339"
         y="129.96001"
         id="tspan286">chokoladeskærekagen og butikkens scones med </tspan><tspan
         x="0 8.4455004 14.25 16.891001 22.173 25.3365 30.6185 35.900501 41.705002 46.987 49.627998 52.269001 55.175999 57.817001 60.458 66.262497 71.544502 75.239998 81.044502 89.489998 92.397003 98.2015 104.006 106.647 111.929 115.6245 121.429 127.2335 130.929 136.211 141.493 147.2975 152.5795 158.384 161.291 166.573 170.26849 173.17551 177.92551 186.371 190.0665 195.871 198.778 204.06 207.75549 210.66251 216.467 221.74899"
         y="142.95599"
         id="tspan288">æble­kanel, ligesom gulerodskagen er værd at gå </tspan><tspan
         x="0 5.2820001 8.9775 12.673 17.955 20.7784 23.419399 26.326401 31.6084 36.8904 39.797401 43.492901 51.9384 57.220402 62.502399 67.784401 73.588898 78.870903 82.566399 86.261902 92.066399 97.870903 101.5664 106.8484 112.6529 115.5599 120.8419 124.5374 127.4444 133.2489 138.5309 142.22639 145.13341 147.7744 153.5789 159.38341 164.66541 170.46989 173.37691 178.12691 183.40891 186.0499 188.95689 194.7614 200.5659 205.8479 211.6524 214.5594 220.36391 228.8094"
         y="155.952"
         id="tspan290">efter. På småkagefronten er der ingen vej uden om </tspan><tspan
         x="0 5.8045001 11.609 15.3045 17.945499 23.227501 28.509501 33.7915 39.596001 43.2915 46.198502 52.002998 54.644001 59.925999 65.730499 71.535004 74.698502 78.393997 83.676003 86.317001 91.067001 94.230499 99.512497 105.317 111.1215 115.3395 120.6215 126.426 130.12151 133.0285 141.474 146.756 152.5605 155.4675 159.16299 167.60851 172.8905 175.7975 184.243 186.884 192.68851 195.3295 200.6115 205.89349 211.698 216.98 219.80341 222.4444"
         y="168.948"
         id="tspan292">butikkens bland­selv­koncept med små minikager, </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 26.657 32.461498 35.3685 41.173 43.813999 49.096001 54.900501 60.705002 65.987 69.682503 72.5895 78.393997 84.198502 86.8395 92.121498 97.926003 101.6215 104.2625 110.067 113.7625 116.6695 120.365 126.1695 134.61501 137.522 143.32651 145.9675 151.2495 157.054 162.85851 166.022 169.7175 174.9995 177.6405 182.3905 185.554 189.2495 191.8905 194.53149 199.81351 202.7205 208.52499 213.80701"
         y="181.944"
         id="tspan294">som du blander nøjagtigt som bland­selv­slik på </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.063999 25.346001 31.150499 33.7915 36.698502 41.448502 46.730499 49.637501 54.919498 60.2015 66.005997 68.913002 74.717499 80.522003 83.429001 86.07 91.874496 94.781502 100.0635 102.7045 106.4 109.041 114.8455 117.7525 120.3935 126.198 132.0025 137.2845 140.1915 145.4735 151.278 154.185 157.88049 163.685 167.38049 170.28751 176.092 181.37399 187.1785 192.46049 196.15601 199.8515 205.1335 207.95689"
         y="194.94"
         id="tspan296">tanken. Så kan du jo altid løbe en tur bagefter.</tspan></text>

         y="25.992001"
         id="tspan312">siden 1950’erne huset SchweizerBageriet, og de </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.063999 23.759501 27.455 32.737 35.644001 40.925999 46.208 49.115002 54.396999 58.092499 60.9995 66.804001 72.085999 75.781502 78.688499 84.492996 89.775002 95.579498 98.486504 101.1275 109.573 113.2685 118.5505 122.246 128.05051 133.855 139.6595 144.9415 150.746 156.55051 161.8325 167.63699 172.91901 175.826 180.75745 183.39845 189.20296 194.48495 197.39195 202.14195 207.42395 210.06496 215.34695 219.04245"
         y="38.987999"
         id="tspan314">seneste 14 år har den læreruddannede Tine Lajer </tspan><tspan

         y="51.984001"

         y="64.980003"
         id="tspan318">butik. Den lange historie betyder dog ikke, at det </tspan><tspan

         y="77.975998"

         y="90.972"
         id="tspan322">og co. finder hele tiden på nye produkter og har </tspan><tspan

         y="103.968"
         id="tspan324">i tidernes løb vundet priser for blandt andet årets </tspan><tspan

         id="tspan326">bedste brød og Danmarks bedste rugbrød. Et af </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 17.688999 22.971001 28.775499 34.057499 37.752998 41.448502 46.730499 49.637501 53.333 58.615002 64.419502 70.223999 73.130997 78.935501 84.217499 87.124496 90.82 94.515503 99.797501 108.243 116.6885 121.9705 127.775 130.68201 135.964 139.6595 142.5665 148.371 154.17551 157.871 160.51199 165.79401 171.076 176.358 182.16251 185.858 188.765 192.46049 197.74249 203.02451 208.3065 210.94749 216.752 220.44749 225.72951"
         y="129.96001"
         id="tspan328">de seneste skud på stammen er butikkens såkaldte </tspan><tspan
